import "./style.css";

function App() {
  return (
    <>
      <header>
        <div className="logo">
          <img src="logo.png" width="68" height="68" alt="Logo" />
          <h1>Knowledge Forum</h1>
        </div>
        <button classNames="btn btn-large" id="show-form-btn">
          Share a fact
        </button>
      </header>
      <NewFactForm />
      <main>
        <CategoryFilter />
        <FactList />
      </main>
    </>
  );
}

function NewFactForm() {
  return <form></form>;
}

function CategoryFilter() {
  return <aside></aside>;
}

function FactList() {
  return <section></section>;
}

export default App;
